<p>مكنسة كهربائية لاسلكية للسيارة مزودة بفلتر قابل للفصل لضمان قوة التنظيف المحمولة. مع 3 فوهات مختلفة للمرفقات ، تتيح لك مكنسة عالية الطاقة للسيارة التنظيف بسهولة في المناطق التي يصعب الوصول إليها. إنه يحتوي على كوب غبار سعة ونظام مغلق بالكامل مع فلتر لاقتحام الغبار والمواد المثيرة للحساسية. يتضمن فرشاة التي تلتقط الشعر والحطام وتنظف بعمق من جميع الأسطح.</p>
